import React from "react";
import { WatchExperience } from "./WatchExperience";
import { ListenExperience } from "./ListenExperience";
// import { SearchResults } from "./SearchResults";

export function Experience({ currentExperience, watch, listen }) {
  console.log(currentExperience, watch, listen);
  console.table(listen);
  if (currentExperience === "WATCH") {
    console.log("rendering watch experience", watch);
    return <WatchExperience watch={watch} />;
  } else {
    return <ListenExperience listen={listen} />;
  }
}
